DROP TRIGGER IF EXISTS `t_afterupdate_on_device`;
DELIMITER ;;
CREATE TRIGGER `t_afterupdate_on_device` AFTER UPDATE ON `Device` FOR EACH ROW BEGIN  
		update Relation_DeviceEnterMap  set  devicesuffix = new.devicesuffix where devicesuffix =old.devicesuffix ;		 
		update Relation_DeviceCustomerMap  set  devicesuffix = new.devicesuffix where devicesuffix =old.devicesuffix ;		 
	 
		 
  END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `t_afterdelete_on_device`;
DELIMITER ;;
CREATE TRIGGER `t_afterdelete_on_device` AFTER DELETE ON `Device` FOR EACH ROW BEGIN
  delete from Relation_DeviceEnterMap where DeviceSuffix =old.DeviceSuffix;
  delete from Relation_DeviceCustomerMap where DeviceSuffix =old.DeviceSuffix;
  END
;;
DELIMITER ;
